import React from 'react'
import './ToduList.css'

function ToduList() {
  const todosSample = [
    {id:1 , todo:"todo1"},
    {id:2 , todo:"todo2"},
    {id:3 , todo:"todo3"},
    {id:4 , todo:"todo4"}
  ]
  return (
    <div className='ToduList'>
        <h1>ToduList</h1>
        <table>
          {todosSample.map((item , index)=>{
            return(
              <div className='tableCond'>
                <tr key={item.id}>
                  <td><input type="checkbox" id={item.id} name={item.todo} value={true} /></td>
                  <td>{item.todo}</td>
                  <td><button>Delete</button></td>
                </tr>
              </div>)
          })}
        </table>
    </div>
  )
}

export default ToduList
